export default function BlackGray ({
  black,gray,txt
}) {

  let tit = [
    <><strong>닉네임</strong><span>을 입력해주세요</span></>,
    <><strong>활발한 매칭</strong><span>을 위해</span><br/>></>,

  ]
  
  return (
    <>
      <span>{tit[0]}</span>
    </>
  )
}
